import { CardFactory } from "botbuilder";
//import welcomeImage from "./welcomeCardImage";

const Signincard = CardFactory.adaptiveCard({
    "version": "1.2",
    "type": "AdaptiveCard",
    "body": [{
        "type": "TextBlock",
        "text": "**Welcome!**",
        "size": "Large"
    },
    {
        "type": "Container",
        "items": [{
            "type": "Image",
            "horizontalAlignment": "center",
            "url":"data:image/png;base64,",
            "height": "180px"
        }]
    },
    {
        "type": "TextBlock",
        "text": "Hello, I am Quadra Thankz Bot and I can help you show your application towards the good work of your peers.",
        "wrap": true
    }
    ],
    "actions": [
        {
            "type": "Action.Submit",
            "title": "Take a tour",
            "data": {
                "status": "Take a tourb",
                "msteams": {
                    "type": "imBack",
                    "value": "Take a tour"
                }
            }
        }
        
    ]
})
export default Signincard;